import React from 'react';

import classes from './Submenu.module.css';

const Submenu = () => (
    <div className={classes.Submenu}>
        <ul>
            <li>Services</li>
            <li>Personell</li>
            <li>Reviews</li>
        </ul>
    </div>
);

export default Submenu;
